requests.description:
Cria um usuário e um perfil de parente.
O perfil de parente é importante pois será a interface de contato do membro da família com a escola.
A outra opcao consiste em alguns passos adicionais:
- Criar um usuario;
- Criar um parente, passando o id do usuario como parametro;

